                            <thead class="thead-dark">
                                <tr>
                                    <th scope="col">#</th>
                                    <th scope="col">Name</th>
                                    <th scope="col">phone Number</th>
                                    <th scope="col">CreatedAt</th>
                                    <th scope="col">UpdatedAt</th>
                                </tr>
                            </thead>
                            <tbody>
                                {product.map((data, index) => {
                                    return (
                                        <tr>
                                            <th scope="row">{index + 1}</th>
                                            <td onClick={() => button(data)}><h3 style={{ color: 'blue' }}>{data.name}</h3></td>
                                            <td>{data.phoneNumber ? data.phoneNumber : "phoneNumber"}</td>
                                            <td>{moment(data.createdAt).format('DD MMM YYYY, HH:mm')}</td>
                                            <td>{moment(data.updatedAt).format('DD MMM YYYY, HH:mm')}</td>
                                        </tr>
